import { useState } from "react";

const Home = () => {
  const [name, setName] = useState("rejish");
  const handleClick = (e) => {
    console.log("button clicked", e.target);
  };

  const handleClickAgain = (name, e) => {
    console.log(`button again cliked with ${name} `, e.target);
  };

  return (
    <div className="home">
      <h1>Homepage</h1>
      <button onClick={handleClick}>Click me</button>
      <button onClick={(e) => handleClickAgain("rejish", e)}>
        Click me again
      </button>
      <h4>{name}</h4>
    </div>
  );
};

export default Home;
